import React from "react";

const App = () =>{

    return(

        <div className = "main_box">
        <div className = "card_box">
            <h1 className="heading">To Do List!</h1>
            <input type="text" placeholder="Type your name"/>
            <button>Click</button>
        </div>
        </div>
     

    );

}

export default App;
